import React, { useEffect } from "react";
import "./Home.scss";
import { Table, Container, Row, Col } from "react-bootstrap";
import { useParams, Redirect } from "react-router-dom";
import NavBar from "../Main/NavBar/NavBar.jsx";
import { useSelector } from "react-redux";

const Home = (props) => {
  const lang = useSelector((state) => state.appState.lang);
  const playerInfo = useSelector((state) => state.appState.playerInfo);
  const { name } = useParams();

  return (
    <Row className="home-row mt-3">
      <Col md={{ span: 8 }} sm={{ span: 11 }}>
        <div className="profile-header">
          <div className="change-pic-area">
            <img src={playerInfo.photo} id="" />
          </div>
        </div>
      </Col>
      <Col md={{ span: 3 }} sm={{ span: 11 }} className="mt-sm-3 mt-md-0">
        <div className="find-players">Col-2</div>
      </Col>
    </Row>
  );
};

export default Home;
